void hls_cropping_vert_strm::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"src_V_V_TDATA\" :  \"" << src_V_V_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"src_V_V_TVALID\" :  \"" << src_V_V_TVALID.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"src_V_V_TREADY\" :  \"" << src_V_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dst_V\" :  \"" << dst_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dst_V_ap_vld\" :  \"" << dst_V_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sof_dst_V\" :  \"" << sof_dst_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"sof_dst_V_ap_vld\" :  \"" << sof_dst_V_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"eol_dst_V\" :  \"" << eol_dst_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"eol_dst_V_ap_vld\" :  \"" << eol_dst_V_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dst_valid_dst_V\" :  \"" << dst_valid_dst_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dst_valid_dst_V_ap_vld\" :  \"" << dst_valid_dst_V_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"src_valid_V\" :  \"" << src_valid_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sof_src_V\" :  \"" << sof_src_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"hsync_V\" :  \"" << hsync_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"hsync_V_ap_vld\" :  \"" << hsync_V_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"vsync_V\" :  \"" << vsync_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"vsync_V_ap_vld\" :  \"" << vsync_V_ap_vld.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

